import "./Main.css";

    function Main() {
    return (
        <div className="home">
        <MainLayout
            sxBackground={{
            backgroundColor: "#7fc7d9", 
            backgroundPosition: "center",
            }}
        >
            <h1 color="inherit" align="center" variant="h2" marked="center">
            Upgrade your Sundays
            </h1>
            <h1
            color="inherit"
            align="center"
            variant="h5"
            sx={{ mb: 4, mt: { sx: 4, sm: 10 } }}
            >
            Enjoy secret offers up to -70% off the best luxury hotels every
            Sunday.
            </h1>
            <button
            color="secondary"
            variant="contained"
            size="large"
            component="a"
            href="/premium-themes/onepirate/sign-up/"
            sx={{ minWidth: 200 }}
            >
            Register
            </button>
            <h1 variant="body2" color="inherit" sx={{ mt: 2 }}>
            Discover the experience
            </h1>
        </MainLayout>
        </div>
    );
}

export default Main;
